    numClicks: number
    isFocused: boolean
}

class CustomMetric extends StreamlitComponentBase<State> {
    public state = { numClicks: 0, isFocused: false}

    public render = (): ReactNode => {
        return (
            <span>
                Hello!
            </span>
        )
    }
}

